package com.sol.pj.tour;

public class SearchRank {
	private String word;
	private int count;
	
	public SearchRank() {
		// TODO Auto-generated constructor stub
	}

	public SearchRank(String word, int count) {
		super();
		this.word = word;
		this.count = count;
	}

	public String getWord() {
		return word;
	}

	public void setWord(String word) {
		this.word = word;
	}

	public int getCount() {
		return count;
	}

	public void setCount(int count) {
		this.count = count;
	}
	
	
}
